import { count } from 'console';
import React, { useEffect, useState } from 'react';
import './App.css';

type MilkInformation = {
  count: number;
  results : {
    name: string;
    type: string;
    storage: number;
    id: string;
  }
}

function App() {
  const [milkData, setMilkData] = useState<MilkInformation>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch(" https://localhost:7023/api/milk");
      const MilkResults = await response.json();
      setMilkData(MilkResults);
    }
    getData();
  }, [])

  return (
    <div>
      {milkData}
    </div>
  );
}

export default App;
